import { Link,useNavigate } from "react-router-dom";
import React, {useState} from "react";
import {useDispatch} from 'react-redux';
import {signup} from "../../redux/actions/auth";

import Box from '@mui/material/Box';
import Card from '@mui/material/Card';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import AppBar from '@mui/material/AppBar';
import { Toolbar } from "@mui/material";
import Grid from '@mui/material/Grid';

const InitState = {
    userName: "",
    email: '',
    password: '',
    confirmPassword: ''
}

function Signup() {
	const nagivate = useNavigate();
    const dispatch = useDispatch();
    const [sForm, setsForm] = useState(InitState)

    const handleChange = (e) => setsForm({
        ...sForm,
        [e.target.name]: e.target.value
    });

	function handleOnSubmit(e) {
        e.preventDefault();
        if (sForm.firstName !== "" && sForm.lastName !== "" && sForm.password !== "" && sForm.confirmPassword !== "" && sForm.email !== "" && sForm.password === sForm.confirmPassword && sForm.password.length >= 4) {
            dispatch(signup(sForm,nagivate))
        }
    }

	const googleAuth = () => {
		window.open(
			`http://localhost:8080/auth/google/callback`,
			"_self"
		);
	};
	return (
		<div >
			<AppBar position="fixed">
            <Toolbar>
            <Typography variant="h6" noWrap component="div">
              Welcome!
            </Typography>

            </Toolbar>

          </AppBar>

			<Card variant="outlined" sx={{ mt:16, pt:3, mx:40, pb:40}} >

			<h1 >Sign up Form</h1>
			<div >
				<div >
				</div>
				<div >
					<h2 >Create Account</h2>
					<input onChange={handleChange} type="text" placeholder="Username" />
					<input  onChange={handleChange} type="text" placeholder="Email" />
					<input  onChange={handleChange}type="password"
						placeholder="Password"
					/>
					<button onClick={handleOnSubmit}  >Sign Up</button>

					<p >or</p>
					<button  onClick={googleAuth}>
						<span>Sing up with Google</span>
					</button>
					<p >
						Already Have Account ? <Link to="/login">Log In</Link>
					</p>
				</div>
			</div>
			</Card>
		</div>
	);
}

export default Signup;
